import { Carousel } from 'react-responsive-carousel';
import GaugeChart from 'react-gauge-chart';
import styled from 'styled-components';
import theme from '../Theme/theme';
import bp from '../Theme/breakpoints';
const BoxContentWrapper = styled.div`
	display: grid;
	grid-template-columns: repeat(2, 0.3fr);
	grid-column-gap: 2px;
	grid-row-gap: 28px;
	margin: 20px;
`;

const BoxContent = styled.div`
	display: flex;
	flex-direction: column;
	padding: 24px;
	background: rgba(0, 0, 0, 0.5);
	backdrop-filter: blur(10px);
	border-radius: 16px;
	color: ${theme.color.text.primary};
	border: 1px solid rgba(255, 255, 255, 0.5);
	@media ${bp.sm} {
		max-width: 200px;
		height: 150px;
	}
`;
const AssetCards = () => {
	return (
		<Carousel showStatus={false} swipeable={false} renderIndicator={false}>
			<BoxContentWrapper>
				{[...Array(4)].map((e, i) => {
					<li key={i}>
						<BoxContent>
							<GaugeChart
								id={i}
								nrOfLevels={30}
								colors={['#FF5F6D', '#FFC371']}
								arcWidth={0.3}
								percent={0.37}
							/>
						</BoxContent>
					</li>;
				})}
			</BoxContentWrapper>
			<BoxContentWrapper>
				<BoxContent>2.1</BoxContent>
				<BoxContent>2.2</BoxContent>
				<BoxContent>2.3</BoxContent>
				<BoxContent>2.4</BoxContent>
			</BoxContentWrapper>
			<BoxContentWrapper>
				<BoxContent>3.1</BoxContent>
				<BoxContent>3.2</BoxContent>
				<BoxContent>3.3</BoxContent>
				<BoxContent>3.4</BoxContent>
			</BoxContentWrapper>
			<BoxContentWrapper>
				<BoxContent>4.1</BoxContent>
				<BoxContent>4.2</BoxContent>
				<BoxContent>4.3</BoxContent>
				<BoxContent>4.4</BoxContent>
			</BoxContentWrapper>
			<BoxContentWrapper>
				<BoxContent>5.1</BoxContent>
				<BoxContent>5.2</BoxContent>
				<BoxContent>5.3</BoxContent>
				<BoxContent>5.4</BoxContent>
			</BoxContentWrapper>
		</Carousel>
	);
};

export default AssetCards;
